(2377,	27,	1,	1189,	'&lt;p&gt;Veuillez nous indiquez vos id&eacute;es et votre opinion &agrave; propros de l\'appli Opal.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:50:52',	'QUESTIONNAIRE_MIGRATION_2019'),
(2378,	27,	2,	1189,	'&lt;p&gt;Please share your ideas and opinions about the Opal app.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:48:58',	'QUESTIONNAIRE_MIGRATION_2019'),
(2381,	27,	1,	1191,	'&lt;p&gt;Les patients signalent parfois qu\'ils pr&eacute;sentent les sympt&ocirc;mes suivants. Veuillez indiquer la s&eacute;v&eacute;rit&eacute; des sympt&ocirc;mes que vous avez ressentis lors de la derni&egrave;re semaine.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2382,	27,	2,	1191,	'&lt;p&gt;Patients sometimes report that they have the following symptoms or problems. Please indicate the extent to which you have experienced these symptoms or problems during the past week.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2383,	27,	1,	1192,	'&lt;p&gt;Ce court questionnaire vous permet de donner votre avis sur vos exp&amp;eacute;riences lors de l’utilisation de l’application Opal. Vos r&amp;eacute;ponses nous aideront &amp;agrave; am&amp;eacute;liorer davantage Opal.&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-12 19:57:28',	'jvyas'),
(2384,	27,	2,	1192,	'&lt;p&gt;This short questionnaire allows you to provide feedback about your experiences using Opal. Your responses will help us further improve Opal.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2387,	27,	1,	1194,	'&lt;p&gt;N/A&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2388,	27,	2,	1194,	'&lt;p&gt;N/A&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2391,	27,	1,	1196,	'&lt;p&gt;Veuillez prendre un moment pour remplir ce questionnaire avant de consulter votre médecin. Les réponses que vous apportez fourniront à votre médecin un aperçu de votre santé et vous feront gagner du temps lors de votre rendez-vous.&lt;/p&gt;&lt;p&gt;Si vous avez des questions ou si vous avez des doutes, veuillez en informer votre médecin.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-12 19:59:50',	'jvyas'),
(2392,	27,	2,	1196,	'&lt;p&gt;Please take a moment to complete this questionnaire before you see your physician. The answers you provide will provide your physician with a snapshot of your health and will save time during your appointment.&lt;/p&gt;&lt;p&gt;If you have any questions or are unsure of an answer, please let your physician know.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2397,	27,	1,	1199,	'&lt;p&gt;L\'&eacute;quipe de d&eacute;veloppement d\'Opal est en train de d&eacute;velopper une extension d\'Opal appel&eacute;e OpalCare. OpalCare vous permettra de partager en toute s&eacute;curit&eacute; tout ou une partie de: vos rendez-vous, informations de stationnement, r&eacute;sultats de tests sanguins, documents cliniques, mat&eacute;riel &eacute;ducatif, etc. avec votre ou vos proches aidants. Un proche aidant est une connaissance personnelle (un membre de votre famille, un ami ou un voisin, par exemple) qui vous aide &agrave; r&eacute;pondre &agrave; certains de vos besoins en lien avec votre cancer. Nous sollicitons votre contribution afin de nous aider &agrave; d&eacute;velopper OpalCare. Merci de prendre quelques minutes pour r&eacute;pondre &agrave; ce bref sondage.&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2398,	27,	2,	1199,	'&lt;p&gt;The Opal development team is in the process of developing an extension of Opal called OpalCare. OpalCare will allow you to securely share some or all of: your appointments, parking information, blood test results, clinical documents, educational material, etc. with your personal caregiver(s). A personal caregiver is a personal acquaintance (ie. family member, friend, neighbour) who is helping you with any of your cancer needs. We are seeking your input in order to help us to design OpalCare. Thank you for for taking a few minutes to complete this brief survey.&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2399,	27,	1,	1200,	'&lt;p&gt;&lt;span style=\"font-size: 14px;float: none;\"&gt;L\'&eacute;quipe de d&eacute;veloppement d\'Opal est en train de d&eacute;velopper une extension d\'Opal appel&eacute;e OpalCare. OpalCare vous permettra de partager en toute s&eacute;curit&eacute; tout ou une partie de: vos rendez-vous, informations de stationnement, r&eacute;sultats de tests sanguins, documents cliniques, mat&eacute;riel &eacute;ducatif, etc. avec votre ou vos proches aidants. Un proche aidant est une connaissance personnelle (un membre de votre famille, un ami ou un voisin, par exemple) qui vous aide &agrave; r&eacute;pondre &agrave; certains de vos besoins en lien avec votre cancer. Nous sollicitons votre contribution afin de nous aider &agrave; d&eacute;velopper OpalCare. Merci de prendre quelques minutes pour r&eacute;pondre &agrave; ce bref sondage.&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2400,	27,	2,	1200,	'&lt;p&gt;&lt;span style=\"font-size: 14px;float: none;\"&gt;The Opal development team is in the process of developing an extension of Opal called OpalCare. OpalCare will allow you to securely share some or all of: your appointments, parking information, blood test results, clinical documents, educational material, etc. with your personal caregiver(s). A personal caregiver is a personal acquaintance (ie. family member, friend, neighbour) who is helping you with any of your cancer needs. We are seeking your input in order to help us to design OpalCare. Thank you for for taking a few minutes to complete this brief survey.&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2413,	27,	1,	1207,	'&lt;p&gt;Nous espérons que vous trouvez l\'application Opal utile. Nous attachons une grande importance aux commentaires d\'utilisateurs tels que vous, qui nous aident à comprendre ce qui fonctionne bien et ce qui peut être amélioré.&lt;/p&gt;&lt;p&gt;Pour en savoir plus sur votre expérience en tant qu\'utilisateur d\'Opal et pour connaître votre avis sur son avenir, nous avons créé un court questionnaire de 20 questions.&lt;/p&gt;&lt;p&gt;Veuillez prendre quelques instants pour nous faire part de vos commentaires importants en remplissant ce questionnaire.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-12 20:04:50',	'jvyas'),
(2414,	27,	2,	1207,	'&lt;p&gt;We hope that you are finding the Opal app useful. We value feedback from users like you that helps us to understand what is working well and what can be improved.&lt;/p&gt;&lt;p&gt;To learn about your experience using Opal and to hear your thoughts regarding its future, we have made a short 20-question questionnaire. &lt;/p&gt;&lt;p&gt;Please take a few moments to provide us with your important feedback by completing this questionnaire.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-12 20:04:50',	'jvyas'),
(2415,	27,	1,	1208,	'&lt;p&gt;Votre radio-oncologue, soit le Dr Faria, Hijal ou Kopek, aimerait que vous remplissiez ce questionnaire. Vos réponses seront examinées par votre radio-oncologue et utilisées pour orienter votre rendez-vous. À la fin de votre rendez-vous, vos réponses seront ajoutées à votre dossier.&lt;/p&gt;&lt;p&gt;L\'objectif de ce questionnaire est d\'évaluer le fonctionnement de vos intestins. Veuillez sélectionner une seule réponse à chaque question. Il se peut qu\'il soit difficile de ne sélectionner qu\'une seule réponse, puisque vos symptômes peuvent varier d\'un jour à l\'autre. C\'est pourquoi nous vous prions de choisir la réponse qui décrit le mieux votre expérience de vie au quotidien. Si vous avez récemment eu une infection affectant vos intestins, veuillez ne pas en tenir compte et répondre de façon à refléter du mieux possible le fonctionnement de vos intestins au quotidien.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 20:20:26',	'QUESTIONNAIRE_MIGRATION_2019'),
(2416,	27,	2,	1208,	'&lt;p&gt;Your Radiation Oncologist (either Dr. Faria, Dr. Hijal, or Dr. Kopek) has requested that you please complete this questionnaire. The answers you provide will be viewed by your Radiation Oncologist and used to help focus your appointment. At the end of your appointment, they will be added to your file.&lt;/p&gt;&lt;p&gt;The aim of this questionnaire is to assess your bowel function. Please select only one response for each question. It may be difficult to select only one answer, as symptoms may vary from day to day. However, we would kindly ask you to choose the one answer which best describes your daily life. If you have recently had an infection affecting your bowel function, please do not take this into account and focus on answering the questions to reflect your usual daily bowel function.&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-12 20:05:40',	'jvyas'),
(2417,	27,	1,	1209,	'&lt;p&gt;Veuillez s&eacute;lectionner la r&eacute;ponse qui d&eacute;crit le mieux votre cancer maintenant.&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
(2418,	27,	2,	1209,	'&lt;p&gt;Please select the answer that best describe your cancer now.&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2019-11-07 09:23:51',	'QUESTIONNAIRE_MIGRATION_2019',	'2019-11-07 19:23:51',	'QUESTIONNAIRE_MIGRATION_2019'),
