(9027,	27,	1,	4511,	'&lt;p&gt;Nous reconnaissons que recevoir un traitement contre le cancer pendant une pandémie peut être stressant. Bien que nous ayons fait de notre mieux pour maximiser votre sécurité, nous savons que nous pouvons encore avoir des points à améliorer. Dans cet esprit, nous vous serions reconnaissants de bien vouloir remplir ce court sondage de 10 minutes (18 questions)  et de nous faire savoir ce que nous avons bien fait et ce qui doit encore être amélioré.&lt;br/&gt;&lt;br/&gt;Nous ne recueillerons aucune information personnelle ni ne tenterons de vous contacter à propos de quoi que ce soit dans cette enquête.&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2020-06-15 16:36:35',	'hpatrick',	'2020-06-16 00:36:35',	'hpatrick'),
(9028,	27,	2,	4511,	'&lt;p&gt;We recognize receiving cancer treatment during a pandemic can be stressful. While we have done our best to maximize your safety, we recognize we may still have areas for improvement. With that in mind, we would appreciate it if you completed this short 10-minute (18 questions) survey and let us know what we\'ve done well and what still needs to be improved. &lt;br/&gt;&lt;br/&gt;We will not collect any personal information or attempt to contact you about anything in this survey.&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2020-06-15 16:36:35',	'hpatrick',	'2020-06-16 00:36:35',	'hpatrick'),
