(10953,	27,	1,	5474,	'&lt;p&gt;L’échelle GAD-7 (Generalized Anxiety Disorder-7) est un outil de dépistage utilisé pour mesurer la sévérité de symptômes anxieux chez les patient(e)s. &lt;br/&gt;&lt;br/&gt;Votre équipe de soins aimerait que vous remplissiez ce questionnaire. Vos réponses seront révisées par votre équipe et utilisées pour orienter votre rendez-vous. &lt;br/&gt;&lt;/p&gt;',	0,	'',	'2020-08-10 14:43:58',	'briana',	'2020-08-10 22:43:58',	'briana'),
