(10965,	27,	1,	5480,	'&lt;p&gt;La détresse est un sentiment d\'inconfort ou un bouleversement qui peut affecter la qualité de vie et nuire au fonctionnement d’une personne. L’outil de dépistage de la détresse utilise le thermomètre de la détresse (adapté et reproduit du NCCN “Distress Management Clinical Practices Guidelines in Oncology,” 2007) et la liste canadienne des problèmes pour évaluer la sévérité de la détresse chez les patient(e)s.&lt;br/&gt;&lt;br/&gt;Votre équipe de soins aimerait que vous remplissiez ce questionnaire. Vos réponses seront révisées par votre équipe et utilisées pour orienter votre rendez-vous. &lt;br/&gt;&lt;/p&gt;',	0,	'',	'2020-08-10 14:58:45',	'briana',	'2020-08-10 22:58:45',	'briana'),
(10966,	27,	2,	5480,	'&lt;p&gt;Distress is a feeling of discomfort or upset that can affect your quality of life and disturb your daily functioning. The Distress Screening Tool uses the Distress Thermometer (adapted and reproduced from the NCCN’s “Distress Management Clinical Practices Guidelines in Oncology,” 2007) and the Canadian Problem Checklist to evaluate the severity of distress in patients.&lt;br/&gt;&lt;br/&gt;Your healthcare team has requested that you please complete this questionnaire. The answers you provide will be viewed by your team and used to help focus your appointment. &lt;br/&gt;&lt;/p&gt;',	0,	'',	'2020-08-10 14:58:45',	'briana',	'2020-08-10 22:58:45',	'briana'),
