(11899,	23,	1,	5947,	'La santé générale comprend le bien-être physique, mental, et social. Nous nous intéressons à la mesure dans laquelle votre santé générale a été bonne ou mauvaise. Veuillez choisir un chiffre entre 1 et 100 pour évaluer votre état de santé général au cours des quatre dernières semaines. 100 est la meilleure santé possible, 1 est le pire état de santé possible.',	0,	'',	'2020-08-21 11:48:49',	'romina',	'2020-08-21 19:48:49',	'romina'),
(11900,	23,	2,	5947,	'Overall health includes physical, mental, and social well-being. We are interested in how good or bad you think your overall health has been. Please select a number between 1 and 100 to rate your overall health during the past four weeks. 100 is the best possible health, 1 is the worst possible health.',	0,	'',	'2020-08-21 11:48:49',	'romina',	'2020-08-21 19:48:49',	'romina'),
