(11911,	27,	1,	5953,	'&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Votre oncologue aimerait que vous remplissiez ce questionnaire. Après avoir rempli le questionnaire, les réponses que vous fournirez seront ajoutées à votre dossier. &lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Les questions portent sur votre &lt;/span&gt;&lt;b style=&quot;font-size: 14px;&quot;&gt;qualité de vie&lt;/b&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt; au quotidien. Elles ont été créées avec l’apport de personnes atteintes du cancer de la vessie. Bien que certaines questions portent sur des sujets liées au cancer de la vessie, veuillez tenir compte de votre état de santé général lorsque vous répondez à chaque question.&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Pour chacune des questions suivantes, veuillez choisir la seule réponse qui décrit le mieux votre expérience au cours des&lt;/span&gt;&lt;b style=&quot;font-size: 14px;&quot;&gt; quatre dernières semaines&lt;/b&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;.&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;',	0,	'',	'2020-08-21 12:02:18',	'romina',	'2020-08-21 20:02:18',	'romina'),
(11912,	27,	2,	5953,	'&lt;p style=&quot;font-size: 14px;&quot;&gt;Your oncologist has requested that you please complete this questionnaire. After completing the questionnaire, the answers you provide will be added to your file.&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;The questions ask about your day-to-day &lt;b&gt;quality of life&lt;/b&gt;. They were created with input from people with bladder cancer. Although some questions focus on bladder cancer-related issues, please consider your overall health when answering each question. &lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;For each of the following questions please select the one answer that best describes your experience in the past &lt;b&gt;four weeks&lt;/b&gt;.&lt;/p&gt;',	0,	'',	'2020-08-21 12:02:18',	'romina',	'2020-08-21 20:02:18',	'romina'),
