(12391,	27,	1,	6193,	'&lt;p&gt;&lt;/p&gt;&lt;p&gt;Vous avez reçu un diagnostic positif pour la COVID-19. Vous êtes invité à remplir ce questionnaire chaque jour pendant 14 jours. En complétant ce questionnaire à tous les jours, vous fournirez des informations importantes sur vos symptômes et vos signes vitaux.  Ces informations seront revues par une infirmière à tous les jours pour évaluer vos besoins en termes de soins.  Ce questionnaire fournira aussi des conseils importants.&lt;/p&gt;&lt;div&gt;Si vous n’êtes pas en mesure de remplir ce questionnaire par vous-même, il peut être complété par quelqu’un d’autre.&lt;span id=&quot;selectionBoundary_1599255062351_8462393431370037&quot; class=&quot;rangySelectionBoundary&quot;&gt;&amp;#65279;&lt;/span&gt;&lt;/div&gt;',	0,	'',	'2020-09-04 17:29:53',	'yuanchao',	'2020-09-05 01:39:43',	'yuanchao'),
