(16870,	27,	1,	8381,	'&lt;p&gt;&lt;i style=&quot;font-size: 14px;&quot;&gt;&lt;i&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Les domaines suivants peuvent rendre difficile de prendre vos médicaments pour le VIH, tels que prescrits.&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;&lt;u&gt;Au cours des 4 dernières semaines&lt;/u&gt;, à quelle fréquence ces domaines ont-ils rendu difficile la prise de vos médicaments pour le VIH ? Par difficile, nous entendons que la prise de vos médicaments a été soit sautée, retardée ou très déplaisante.&lt;/span&gt;&lt;br style=&quot;font-size: 14px;&quot;/&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;&lt;/span&gt;Notez votre réponse de 0% à 100%.&lt;/i&gt;&lt;/i&gt;&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2020-12-09 15:15:59',	'MAYU6004',	'2020-12-10 01:15:59',	'MAYU6004'),
