(22557,	27,	1,	10277,	'&lt;p&gt;Certaines personnes ont des habitudes intestinales irrégulières en raison de certains aliments dans leur alimentation. Dans certains cas, ces habitudes intestinales peuvent contribuer à augmenter la probabilité de certains effets secondaires de la radiothérapie.&lt;br/&gt;&lt;br/&gt;Dans le cadre de l\'étude OUTGAS dont vous&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;participez&lt;/span&gt;, veuillez indiquer lesquels des aliments suivants vous avez mangés au cours de la dernière journée.&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2021-05-27 08:49:41',	'PAHA6003',	'2021-09-13 23:17:57',	'jkildea'),
(22558,	27,	2,	10277,	'&lt;p&gt;Some people experience irregular bowel habits due to certain foods in their diets. In some cases, these bowel habits may contribute to increased likelihood of some side effects from radiation therapy.&lt;br/&gt;&lt;br/&gt;As part of the OUTGAS study that you are participating in, please indicate which of the following foods you have eaten in the past day.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2021-05-27 08:49:41',	'PAHA6003',	'2021-09-13 23:17:57',	'jkildea'),
