(22958,	27,	1,	10411,	'&lt;p&gt;&lt;i&gt;Les énoncés suivants portent sur des raisons pour lesquelles il peut être difficile de prendre ses médicaments pour le VIH, tels que prescrits.&lt;br/&gt;&lt;u&gt;Au cours des 4 dernières semaines&lt;/u&gt;, à quelle fréquence les situations suivantes ont-elles rendu difficile la prise de vos médicaments pour le VIH ? Par difficile, nous entendons que la prise de vos médicaments a été soit sautée, retardée ou très déplaisante. &lt;br/&gt;Indiquez votre réponse de 1&lt;i style=&quot;font-size: 14px;&quot;&gt;&lt;i&gt;à 10.&lt;/i&gt;&lt;/i&gt;&lt;!--EndFragment--&gt;&lt;br/&gt;&lt;br/&gt;&lt;/i&gt;&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2021-06-08 17:55:24',	'MAYU6004',	'2021-06-09 01:55:24',	'MAYU6004'),
(22959,	27,	2,	10411,	'&lt;p&gt;&lt;i&gt;The following statements concern reasons why it could be difficult to take your HIV medication, as prescribed. &lt;br/&gt;&lt;u&gt;In the past 4 weeks&lt;/u&gt;, how often did these situations make it difficult to take your HIV medication? By difficult, we mean that taking your medication was either skipped, delayed or very unpleasant. &lt;br/&gt;Mark your response from 1 to 10.&lt;/i&gt;&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2021-06-08 17:55:24',	'MAYU6004',	'2021-06-09 01:55:24',	'MAYU6004'),
