(23739,	27,	2,	10671,	'Modified Harvey Bradshaw Index - Assessment for Crohn’s Disease Activity',	0,	NULL,	'2021-07-21 10:29:24',	'CABR6008',	'2021-07-21 18:29:24',	'CABR6008'),
(23741,	27,	1,	10672,	'&lt;p&gt;Les résultats de ce questionnaire seront examinés UNIQUEMENT au moment de votre rendez-vous. Si vos symptômes s\'aggravent, veuillez nous contacter (voir les coordonnées dans le &lt;i&gt;Guide d\'information sur les maladies inflammatoires de l\'intestin&lt;/i&gt; qui se trouve dans la section Bibliothèque).&lt;br/&gt;&lt;/p&gt;&lt;p&gt;L\'indice de Harvey Bradshaw modifié est une mesure de l\'activité de la maladie pour la maladie de Crohn.&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Basez vos réponses sur ce que vous avez ressenti hier. &lt;/b&gt;&lt;u&gt;En répondant au questionnaire, veuillez compter votre score total en additionnant les scores individuels pour chaque question&lt;/u&gt;. Le score se trouve à droite de l\'option de réponse. À la fin du questionnaire, on vous demandera de noter votre score total. &lt;br/&gt;&lt;b&gt;Exemple :&lt;/b&gt; Si pour une question, vous choisissez la réponse &amp;#34;Modéré = 2&amp;#34;, votre score pour cette question est 2.&lt;/p&gt;&lt;p&gt;Veuillez noter les informations suivantes lors de la sélection de vos réponses :&lt;/p&gt;&lt;p&gt;&lt;b&gt;1. Descripteurs de bien-être général&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Le bien-être général inclut la fatigue et la façon dont vous vous sentez aujourd\'hui dans la note globale. Inscrivez le pire que vous vous êtes senti aujourd\'hui. Comparez-vous à quelqu\'un de votre âge, comment classerait-il son bien-être général ? Vous trouverez ci-dessous quelques descripteurs pour vous aider à classer votre catégorie de bien-être général.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Très bien :&lt;/b&gt; Votre santé générale n\'est pas un problème. Vous vous sentez très bien ou bien et sous contrôle.​​&lt;/li&gt;&lt;li&gt;&lt;b&gt;Légèrement en dessous de la normale :&lt;/b&gt; Vous allez bien mais vous vous sentez en dessous de la normale. Quelque chose vous empêche de dire « Je me sens bien ». Vous vous sentez bien mais pas parfaitement bien. Vous pouvez travailler, socialiser et fonctionnez au quotidien.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Mauvais : &lt;/b&gt;Vos symptômes vous dérangent. Vous manquez parfois le travail, l\'école ou des activités sociales. Vous avez des moments embarrassants en lien avec l\'incontinence fécale. Vous avez de la diarrhée, des douleurs abdominales, de la fatigue et vous vous sentez mal, mais vous êtes toujours capable de fonctionner. Vous passez la journée à faire toutes vos tâches normales, mais c\'est un combat.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Très mauvais :&lt;/b&gt; Vous passez à travers la journée, mais vous n\'arrivez pas à prendre part à vos activités normales. Vous devez parfois quitter le travail plus tôt et vous ne pouvez pas assister à des événements sociaux en soirée. Vous vous sentez très mal et ne faites pas beaucoup d\'activités – seulement celles qui sont absolument nécessaires. Vos symptômes interfèrent considérablement avec votre vie, vous ne sortez pas ou avez peur lorsque vous sortez. Vous manquez beaucoup d\'école ou de travail. L\'incontinence fécale se produit plusieurs fois par semaine.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Terrible : &lt;/b&gt;Vous êtes incapable de fonctionner. Vous ne pouvez pas gérer vos activités de bases et vous êtes presque cloué au lit. C\'est le pire que vous ayez jamais été. Vous ne travaillez pas.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;b&gt;2. Descripteurs de la douleur abdominale&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Les douleurs abdominales peuvent inclure des crampes et de l\'inconfort. Il ne doit pas s\'agir uniquement de « douleur » telle que nous la connaissons. Vous trouverez ci-dessous quelques descripteurs pour vous aider à classer votre catégorie de douleurs abdominales.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Légère : &lt;/b&gt;Vous êtes conscient que la douleur abdominale est présente, mais elle​ n\'interfère pas avec votre vie et vous continuez vos activités telles que le travail et les loisirs. Vous ressentez et entendez des grondements, des gargouillis et des crampes.​&lt;/li&gt;&lt;li&gt;&lt;b&gt;Modéré :&lt;/b&gt; Vous êtes conscient de vos douleurs abdominales et devez modifier vos activités pour gérer la douleur (c.-à-d. vous allonger pour vous reposer, reporter vos achats à plus tard et prendre du Tylenol). La douleur interfère avec votre vie et vos activités quotidiennes. Vous devrez manquer des activités de travail ou de loisir à l\'occasion.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Sévère :&lt;/b&gt; Vos douleurs abdominales vous obligent à arrêter toute activité. Vous êtes souvent au lit à cause de la douleur, vous vous rendez malade au travail et annulez toutes les activités.&lt;br/&gt;&lt;/li&gt;&lt;/ul&gt;',	0,	NULL,	'2021-07-21 10:29:24',	'CABR6008',	'2021-08-20 23:00:25',	'CABR6008'),
(23742,	27,	2,	10672,	'&lt;p&gt;The results of this questionnaire will be reviewed ONLY at the time of your appointment. If you have worsening symptoms, please contact us (see contact information in the&lt;i&gt; Inflammatory Bowel Disease Information Guide&lt;/i&gt; found in the Library section).&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The modified Harvey Bradshaw Index is a measure of disease activity for Crohn’s disease.&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Base your answers on how you felt yesterday. &lt;/b&gt;&lt;u&gt;As you go through the questionnaire, please keep count of your total score by summing the individual scores for each question&lt;/u&gt;. The score is found to the right of the response option. At the end of the questionnaire, you will be asked to enter your total score. &lt;br/&gt;&lt;b&gt;Example:&lt;/b&gt; If for a question, you select the response of &amp;#34;Moderate = 2&amp;#34;, then your score for that question is 2.&lt;/p&gt;&lt;p&gt;Please note the following information when selecting your responses:&lt;/p&gt;&lt;div&gt;&lt;b&gt;1. General Well‐being Descriptors&lt;/b&gt;&lt;br/&gt;General well being includes fatigue in the overall rating and how you feel today. Record the worst you have felt today. Compare yourself to someone else of your age, how would they rank their general well-being? Below are some descriptors to help you rank your category of general well being.&lt;/div&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Very Well: &lt;/b&gt;General health is not generally a problem. You’re feeling very good or great and under control.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Slightly Below Par: &lt;/b&gt;You’re getting through things but feeling below par and not normal. Something overall is preventing you from saying “I feel wonderful”. You’re feeling good but not great. You can work, socialize, and function on a day to day basis.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Poor:&lt;/b&gt; Your symptoms bother you. You occasionally miss work, school, or social activities. You have some embarrassing moments with fecal incontinence. You have diarrhea, abdominal pain, fatigue, and basically just feeling unwell, but you are still able to function. You’re getting through the day, doing all your normal stuff but it is a struggle.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Very Poor:&lt;/b&gt; Your getting through a part of the day, but can’t do your normal stuff. You can’t attend social events in the evening. You sometime leave home from work early. You feel pretty bad and are not doing much activity – only those absolutely necessary. Your symptoms interfere with life considerably, you don’t go out or are fearful when out, you miss a lot of school or work. Fecal incontinence happens several times per week.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Terrible:&lt;/b&gt; You’re unable to function. You can’t manage the basics and you’re almost bedridden. This is the worse you have ever been. You’re not working.&lt;/li&gt;&lt;/ul&gt;&lt;div&gt;&lt;br/&gt;&lt;/div&gt;&lt;div&gt;&lt;b&gt;2. Abdominal Pain Descriptors&lt;/b&gt;&lt;br/&gt;Abdominal pain may include cramping and discomfort. It does not have to be just “pain” as we know it. Below are some descriptors to help you rank your category of abdominal pain.&lt;/div&gt;&lt;div&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Mild:&lt;/b&gt; You’re aware that the abdominal pain is there but it does not​interfere with your life and you continue with activities such as work and pleasure. You feel and hear rumbles, gurgles and cramps.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Moderate:&lt;/b&gt; You’re aware of your abdominal pain and must alter your activities to manage the pain (ie. lie down to rest, postpone shopping trips until later, and take Tylenol). The pain interferes with your life and daily activities. You may have to miss work or pleasure activities on occasion.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Severe: &lt;/b&gt;Your abdominal pain causes you to stop all activity. You are frequently in bed because of the pain, you call in sick to work and cancel all activities.&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;',	0,	NULL,	'2021-07-21 10:29:24',	'CABR6008',	'2021-08-20 23:00:25',	'CABR6008'),
