(23756,	27,	1,	10677,	'Questionnaire d’évaluation de la qualité de vie dans les maladies inflammatoires de l’intestin (IBDQ)',	0,	NULL,	'2021-07-21 10:33:50',	'CABR6008',	'2021-07-21 18:33:50',	'CABR6008'),
(23757,	27,	2,	10677,	'Short Inflammatory Bowel Disease (IBD) Questionnaire',	0,	NULL,	'2021-07-21 10:33:50',	'CABR6008',	'2021-07-21 18:33:50',	'CABR6008'),
(23759,	27,	1,	10678,	'&lt;p&gt;Les résultats de ce questionnaire seront examinés UNIQUEMENT au moment de votre rendez-vous. Si vos symptômes s\'aggravent, veuillez nous contacter (voir les coordonnées dans le &lt;i&gt;Guide d\'information sur les maladies inflammatoires de l\'intestin&lt;/i&gt; qui se trouve dans la section Bibliothèque).&lt;br/&gt;&lt;/p&gt;&lt;p&gt;Ce questionnaire est conçu pour vérifier comment vous vous êtes senti(e) au cours des deux dernières semaines. On vous demande de répondre à des questions concernant les symptômes que vous avez eus en rapport avec vos problèmes intestinaux, la façon dont vous vous êtes senti(e) en général et comment était votre humeur.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Instructions pour le questionnaire sur les maladies inflammatoires de l’intestin (IBDQ) – Version autoadministrée&lt;/b&gt;&lt;br/&gt;&lt;br/&gt;Le SIBDQ est un questionnaire en 10 points sur la qualité de vie liée à la santé (QVLS), validé pour être utilisé par les patients atteints de MII. Il évalue 4 domaines : physique, social, émotionnel et systémique et est noté sur une échelle de Likert en 7 points allant de 1 (problème grave) à 7 (pas de problème du tout). Le score absolu va de 10 (mauvaise QVLS) à 70 (QVLS optimale). Le suivi dans le temps est une mesure utile de la qualité de vie du patient.&lt;br/&gt;&lt;br/&gt;&lt;u&gt;En répondant au questionnaire, veuillez compter votre score total du SIBDQ en additionnant les scores individuels pour chaque question&lt;/u&gt;. Le score se trouve à gauche de l\'option de réponse. À la fin du questionnaire, on vous demandera de noter votre score total.&lt;br/&gt;&lt;b&gt;Exemple :&lt;/b&gt; Si, pour une question, vous choisissez la réponse &amp;#34;2 - Presque tout le temps&amp;#34;, votre score pour cette question est 2.&lt;br/&gt;&lt;br/&gt;Si vous avez de la difficulté à comprendre une question, arrêtez-vous un instant! Pensez à ce que la question signifie pour vous. Comment l’aspect mentionné dans la question est-il touché par vos problèmes intestinaux? Ensuite, répondez à la question du mieux que vous le pouvez. Il ne faut que quelques minutes pour remplir le questionnaire.&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2021-07-21 10:33:50',	'CABR6008',	'2021-08-20 23:01:15',	'CABR6008'),
(23760,	27,	2,	10678,	'&lt;p&gt;&lt;/p&gt;&lt;p&gt;The results of this questionnaire will be reviewed ONLY at the time of your appointment. If you have worsening symptoms, please contact us (see contact information in the&lt;i&gt; Inflammatory Bowel Disease Information Guide&lt;/i&gt; found in the Library section).&lt;br/&gt;&lt;/p&gt;&lt;p&gt;This questionnaire is designed to find out how you have been feeling during the last 2 weeks. You will be asked about symptoms you have been having as a result of your inflammatory bowel disease, the way you have been feeling in general, and how your mood has been.&lt;/p&gt;&lt;div&gt;&lt;b&gt;Instructions for the Inflammatory Bowel Disease Questionnaire (IBDQ) - Self-Administered Version&lt;/b&gt;&lt;/div&gt;&lt;div&gt;&lt;br/&gt;&lt;/div&gt;&lt;div&gt;The SIBDQ is a 10-item health related quality of life (HRQOL) questionnaire validated for use in IBD patients. It assesses 4 domains: physical, social, emotional, and systemic and is scored on a 7-point Likert scale from 1 (severe problem) to 7 (no problem at all). The absolute score ranges from 10 (poor HRQOL) to 70 (optimum HRQOL). Follow-up over time is a useful measure of a patient’s quality of life.&lt;br/&gt;&lt;br/&gt;&lt;u&gt;As you go through the questionnaire, please keep count of your total SIBDQ score by summing the individual scores for each question&lt;/u&gt;. The score is found to the left of the response option. At the end of the questionnaire, you will be asked to enter your total score.&lt;br/&gt;&lt;b&gt;Example:&lt;/b&gt; If for a question, you select the response of &amp;#34;2 - Most of the time&amp;#34;, then your score for that question is 2.&lt;br/&gt;&lt;br/&gt;If you are having trouble understanding a question, stop for a moment! Think about what the question means to you. How is the area mentioned in the question affected by your bowel problems? It only takes a few minutes to complete the questionnaire.&lt;/div&gt;',	0,	NULL,	'2021-07-21 10:33:50',	'CABR6008',	'2021-08-20 23:01:15',	'CABR6008'),
