(23777,	27,	1,	10684,	'&lt;p&gt;Les résultats de ce questionnaire seront examinés UNIQUEMENT au moment de votre rendez-vous. Si vos symptômes s\'aggravent, veuillez nous contacter (voir les coordonnées dans le &lt;i&gt;Guide d\'information sur les maladies inflammatoires de l\'intestin&lt;/i&gt; qui se trouve dans la section Bibliothèque).&lt;br/&gt;&lt;/p&gt;&lt;p&gt;Le score Mayo partiel permet de mesurer l’activité de la colite ulcéreuse ou la colite indéterminée.&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;u&gt;En répondant au questionnaire, veuillez compter votre score total de l\'indice Mayo modifié en additionnant les scores individuels pour chaque question&lt;/u&gt;. Le score se trouve à droite de l\'option de réponse. À la fin du questionnaire, on vous demandera de noter votre score total.&lt;br/&gt;&lt;b&gt;Exemple :&lt;/b&gt; Si, pour une question, vous choisissez la réponse &amp;#34;3-4 selles plus que la normale = 2&amp;#34;, votre score pour cette question est 2.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2021-07-21 10:35:16',	'CABR6008',	'2021-08-23 16:01:50',	'CABR6008'),
(23778,	27,	2,	10684,	'&lt;p&gt;The results of this questionnaire will be reviewed ONLY at the time of your appointment. If you have worsening symptoms, please contact us (see contact information in the&lt;i&gt; Inflammatory Bowel Disease Information Guide&lt;/i&gt; found in the Library section).&lt;br/&gt;&lt;/p&gt;&lt;p&gt;The partial Mayo score is a measure of disease activity for ulcerative colitis or indeterminate colitis.&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;u&gt;As you go through the questionnaire, please keep count of your total modified Mayo Index score by summing the individual scores for each question&lt;/u&gt;. The score is found to the right of the response option. At the end of the questionnaire, you will be asked to enter your total score.&lt;br/&gt;&lt;b&gt;Example:&lt;/b&gt; If for a question, you select the response of &amp;#34;3‐4 stools more than normal = 2&amp;#34;, then your score for that question is 2.&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2021-07-21 10:35:16',	'CABR6008',	'2021-08-23 16:01:50',	'CABR6008'),
